Can you find the smallest non fractional number such that
If the number gets divided by 13 , we get the remainder of 1;
If the number gets divided by 14 , we get the remainder of 2
If the number gets divided by 15 , we get the remainder of 3;
If the number gets divided by 16 , we get the remainder of 4.

